import * as React from 'react';
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogTitle from '@mui/material/DialogTitle';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';
import TextareaAutosize from '@mui/base/TextareaAutosize';
import {useState} from "react"
import {useNavigate} from "react-router-dom"
import  Data  from "./data";

const ButtonUI = () =>{
     const [open, setOpen] = React.useState(false);
     const handleClickOpen = () => {
    setOpen(true);
  };
  const handleClose = () => {
    setOpen(false);
  };

  const [pos, setPos] = React.useState('');
  const handleChange = (event) => {
  setPos(event.target.value);
  }

  let navigate = useNavigate();
  const HandleChange =() =>{
    setUsers({
          ...users,
          name:document.getElementById("name").value,
          email:document.getElementById("email").value,
          Password:document.getElementById("password").value,
      })
  }
  let data = users;
  const redirectHandler =() =>{
      navigate('/data',{state: {users}})
  }

  return (
    <>
      <Button variant="outlined" onClick={handleClickOpen}>
        Click Me
      </Button>
      <Dialog open={open} onClose={handleClose}>
        <DialogTitle>Enter Your Detail's</DialogTitle>
        <DialogContent>
        <TextField
            autoFocus
            margin="dense"
            id="name"
            label="Name"
            type="name"
            fullWidth
            variant="standard"
          />
          <TextField
            autoFocus
            margin="dense"
            id="name"
            label="Email Address"
            type="email"
            fullWidth
            variant="standard"
          />
          <FormControl variant="filled" sx={{ m: 1, minWidth: 120 }}>
        <InputLabel id="demo-simple-select-filled-label">Position</InputLabel>
        <Select
          labelId="demo-simple-select-filled-label"
          id="demo-simple-select-filled"
          value={pos}
          onChange={handleChange}
        >
          <MenuItem value="">
            <em>None</em>
          </MenuItem>
          <MenuItem value={10}>Trainee</MenuItem>
          <MenuItem value={20}>Trainer</MenuItem>
          <MenuItem value={30}>Expert</MenuItem>
        </Select>
        <br></br>
        <TextareaAutosize
            aria-label="minimum height"
            minRows={3}
            placeholder="Discription"
            style={{ width: 200}}
       />

      </FormControl>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose}>Cancel</Button>
          <Button onClick={handleClose,redirectHandler}>Save</Button>
        </DialogActions>
      </Dialog>


    </>
  )
}
export default ButtonUI;
